local Update = true

assert(load(Base64Decode(""), nil, "bt", _ENV))()

AddLoadCallback(function()
	DelayAction(function()
		if Delay then return end
		Delay = true
		if Update then
			local ServerVersion = tonumber(GetWebResult("raw.github.com", "/iAmPain/Bot-of-Legends/master/Revision/AntiRage.version"))
			if ServerVersion > Version then
				Print("Update Available")
				DownloadFile("http://raw.github.com/iAmPain/Bot-Of-Legends/master/AntiRage.lua".."?rand"..math.random(1,9999), SCRIPT_PATH .. "Anti-Rage.lua", function() Print("Downloaded Update.") end)
			end
		end
	end, 1)
end)